import React, { useState, useEffect } from "react";
import Position from "../components/position";
import "./352style.css";
import axios from "axios";

function Formation352() {

  const players = [
    "player0",
    "player1",
    "player2",
    "player3",
    "player4",
    "player5",
    "player6",
    "player7",
    "player8",
    "player9",
    "player10",
  ];

  const roles = [
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role"
  ]

  var roleToPositionMapping = {
    [players[0]]: roles[0],
    [players[1]]: roles[1],
    [players[2]]: roles[2],
    [players[3]]: roles[3],
    [players[4]]: roles[4],
    [players[5]]: roles[5],
    [players[6]]: roles[6],
    [players[7]]: roles[7],
    [players[8]]: roles[8],
    [players[9]]: roles[9],
    [players[10]]: roles[10]
  };

  const formation = "3-5-2"

  const handleRoleChange = (player, newRole) => {
    // Update the role for the specified player
    roleToPositionMapping[player] = newRole;

    // Log the updated mapping
    console.log("Updated role mapping:", roleToPositionMapping);
  };


  const [bestTeam, setBestTeam] = useState(null);

  const handleGetBestTeam = () => {
    const selectedRoles = roleToPositionMapping;

    axios.post('/get_best_team', { selected_roles: selectedRoles, formation: formation })
      .then(response => {
        setBestTeam(response.data);
      })
      .catch(error => {
        console.error('Error fetching the best team:', error);
      });
  };

  useEffect(() => {
    const fetchData = async () => {
        try {
            const response = await axios.get('/get_best_team_saved');
            console.log(response.data)
            setBestTeam(response.data.team);
            var updatedRoles = {
              ...roleToPositionMapping,
              player0: response.data.roles.player0,
              player1: response.data.roles.player1,
              player2: response.data.roles.player2,
              player3: response.data.roles.player3,
              player4: response.data.roles.player4,
              player5: response.data.roles.player5,
              player6: response.data.roles.player6,
              player7: response.data.roles.player7,
              player8: response.data.roles.player8,
              player9: response.data.roles.player9,
              player10: response.data.roles.player10
          };
          roleToPositionMapping = updatedRoles;
          console.log("Updated roles:", roleToPositionMapping);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };


    fetchData();
}, []);


  return (
    <div className="formation352">
      <div className="attackLane352">
      <Position playerName={players[0]} positionName="ATTACK" onRoleChange={(role) => handleRoleChange(players[0], role)} selectedPlayer={bestTeam && `${bestTeam.player0.Nom} (${bestTeam.player0.Note})`} selectedRoles={(roleToPositionMapping.player0)} />
      <Position playerName={players[1]} positionName="ATTACK" onRoleChange={(role) => handleRoleChange(players[1], role)} selectedPlayer={bestTeam && `${bestTeam.player1.Nom} (${bestTeam.player1.Note})`} />
      </div>
      <div className="midLane352">
      <Position playerName={players[2]} positionName="LAT" onRoleChange={(role) => handleRoleChange(players[2], role)} selectedPlayer={bestTeam && `${bestTeam.player2.Nom} (${bestTeam.player2.Note})`}/>
        <Position playerName={players[3]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[3], role)} selectedPlayer={bestTeam && `${bestTeam.player3.Nom} (${bestTeam.player3.Note})`}/>
        <Position playerName={players[4]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[4], role)} selectedPlayer={bestTeam && `${bestTeam.player4.Nom} (${bestTeam.player4.Note})`}/>
        <Position playerName={players[5]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[5], role)} selectedPlayer={bestTeam && `${bestTeam.player5.Nom} (${bestTeam.player5.Note})`} />
        <Position playerName={players[6]} positionName="LAT" onRoleChange={(role) => handleRoleChange(players[6], role)} selectedPlayer={bestTeam && `${bestTeam.player6.Nom} (${bestTeam.player6.Note})`} />
      </div>
      <div className="backLane352">
      <Position playerName={players[7]} positionName="DEF" onRoleChange={(role) => handleRoleChange(players[7], role)} selectedPlayer={bestTeam && `${bestTeam.player7.Nom} (${bestTeam.player7.Note})`}/>
        <Position playerName={players[8]} positionName="DEF"onRoleChange={(role) => handleRoleChange(players[8], role)} selectedPlayer={bestTeam && `${bestTeam.player8.Nom} (${bestTeam.player8.Note})`}/>
        <Position playerName={players[9]} positionName="DEF"onRoleChange={(role) => handleRoleChange(players[9], role)} selectedPlayer={bestTeam && `${bestTeam.player9.Nom} (${bestTeam.player9.Note})`}/>
      </div>
      <div className="gkLane352">
      <Position playerName={players[10]} positionName="GK"onRoleChange={(role) => handleRoleChange(players[10], role)}selectedPlayer={bestTeam && `${bestTeam.player10.Nom} (${bestTeam.player10.Note})`}/>
       </div>
       <button onClick={handleGetBestTeam}>Get Best Team</button>
    </div>

  );
}

export default Formation352;
